    "biography": "Chandler Riggs is an American actor and DJ. He is widely recognized for his portrayal of Carl Grimes in the AMC television series The Walking Dead from 2010 to 2018.\n\nRiggs was born in Atlanta, Georgia, the elder of two children born to Gina Ann and William Riggs. Chandler has a younger brother named Grayson. His interest in the arts began at an early age, leading him to participate in theater productions. In the early stages of his acting career, he played the character of Tom in the film Get Low, where he had the opportunity to work alongside seasoned actors like Bill Murray.\n\nHowever, his major breakthrough came with the television series The Walking Dead, which started in 2010. He played the role of Carl Grimes, the son of Rick and Lori, for a remarkable eight seasons, gaining immense popularity and earning Saturn and Satellite awards for his performance.\n\nBesides acting, Riggs also has a passion for music and runs a YouTube gaming channel under the name \"ChairHandler.\" He has also appeared in films like Mercy, where he played George, and Home Invasion, where he portrayed a DJ.\n\nThrough his successful performance in The Walking Dead, Chandler Riggs has garnered a vast fan base and established himself as a prominent figure in the acting world despite his young age. Continuing his career with various projects, Riggs is poised to make a name for himself in the future.\n\nIMDb mini bio by; yusufpiskin",
