    "biography": "Joseph Peter Pantoliano is an American actor who has played over 150 roles across film, television, and theater. He is best known for portraying Ralph \"Ralphie\" Cifaretto on the HBO crime drama The Sopranos (1999–2007), for which he won a Primetime Emmy Award for Outstanding Supporting Actor in a Drama Series, and Cypher in the sci-fi action film The Matrix (1999).\n\nAfter early roles in the television series M* A * S * H and the comedy film Risky Business, Pantoliano gained recognition for numerous supporting roles in films and television shows such as Hill Street Blues, The Goonies, La Bamba, Empire of the Sun, Midnight Run, NYPD Blue, Memento, and Bad Boys and its sequels. He also appeared in The Fugitive and its spin-off U.S. Marshals. He began working with the Wachowskis in their directorial debut Bound, and later appeared in their film The Matrix and their sci-fi series Sense8.",
