    "name": "Ewan McGregor",
    "img": "https://image.tmdb.org/t/p/w500/g7uF0PD8RwC8v3ywc1NQ3WxvzsF.jpg",
    "wideImg": "https://image.tmdb.org/t/p/w1280/g7uF0PD8RwC8v3ywc1NQ3WxvzsF.jpg",
    "biography": "Ewan Gordon McGregor (born March 3, 1971) is a Scottish actor who has starred in numerous film and musical roles. He won a Golden Globe Award for Best Actor – Miniseries or Television Film for his dual role as brothers Ray & Emmit Stussy in the third season of FX anthology series Fargo, and received Golden Globe nominations for Best Actor – Musical or Comedy for both Moulin Rouge! and Salmon Fishing in the Yemen. He was ranked number 36 on Empire magazine's \"The Top 100 Movie Stars of All Time\" list in 1997. In a 2004 poll for the BBC, he was named the fourth most influential person in British culture.\n\nFrom June 2005 to April 2007, he starred alongside Jane Krakowski, Douglas Hodge and Jenna Russell in the Donmar Warehouse revival of Guys and Dolls after it transferred to the Piccadilly Theatre in London. He played the leading role of Sky Masterson. He received the LastMinute.com award for Best Actor for his performance in 2005, and he was nominated for a Laurence Olivier Award for Best Actor in a Musical in 2007.\n\nIn 2011, he was awarded with the SIFF Golden Space Needle Award for Outstanding Achievement in Acting at the Seattle International Film Festival. At the San Sebastián International Film Festival in 2012, he was awarded the Donostia Lifetime Achievement Award and became the youngest recipient of the award.\n\nIn 2010, he was appointed by the French government as a Chevalier de l'Ordre des Arts et Lettres (Knight of the Order of the Arts and Letters). He was appointed an Officer of the Order of the British Empire (OBE) in the 2013 New Year Honours for services to drama and charity. In September 2024, McGregor received his star on the Hollywood Walk of Fame.\n\nHe has been involved in charity work and has served as an ambassador for UNICEF UK since 2004. He became a naturalised US citizen after 2016 so he would be able to vote in the 2020 US presidential election.\n\nIn 1995, he married Eve Mavrakis, a French-Greek Jewish production designer whom he met on the set of Kavanagh QC. Together they have four daughters, two of them adopted, one a street child from Mongolia he met while travelling in Long Way Round. They separated in September 2018, he filed for divorce in May 2017, and their divorce was finalized in 2020. His daughter Clara had roles in his movies Christopher Robin, The Birthday Cake, and Bleeding Love.\n\nIn May 2017, he began a relationship with American actress Mary Elizabeth Winstead, whom he met on the set of the third season of the Fargo television series. Their son, Laurie, was born on June 27, 2021 and they married in April 2022.\n\n​From Wikipedia, the free encyclopedia.",
