    "biography": "Alicia Silverstone (born October 4, 1976) is an American actress. She made her film debut in the thriller The Crush (1993), earning the 1994 MTV Movie Award for Best Breakthrough Performance, and gained further prominence at the age of 17 as a teen idol when she appeared in the music video for Aerosmith's \"Cryin'\". Silverstone went on to star as Cher Horowitz in the teen comedy film Clueless (1995), which earned her a multi-million dollar deal with Columbia Pictures. In 1997, she starred in the big-budget superhero film Batman & Robin, playing Batgirl.\n\nSilverstone received a Golden Globe nomination for Best Actress – Television Series Musical or Comedy for her role in the short-lived NBC series Miss Match (2003). She has continued to act in film and television and on stage.\n\nA vegan, Silverstone has endorsed PETA activities and has published two cookbooks: The Kind Diet (2009) and The Kind Mama (2014).",
