    "biography": "Andrea Louise Riseborough (born 20 November 1981) is an English actress and producer. She made her film debut with a small part in Venus (2006), and has since appeared in more prominent roles in Happy-Go-Lucky (2008), Never Let Me Go, Brighton Rock, Made in Dagenham (all 2010), W.E. (2011), Shadow Dancer, Disconnect (both 2012), Welcome to the Punch, Oblivion (both 2013), Birdman (2014), Nocturnal Animals (2016), Battle of the Sexes, The Death of Stalin (both 2017), Mandy, Nancy (both 2018), The Grudge, and Possessor (both 2020). For her performance as a recovering addict in the drama To Leslie (2022), Riseborough received a nomination for the Academy Award for Best Actress.\n\nOutside of film, Riseborough received a BAFTA nomination for her portrayal of Margaret Thatcher in the television film The Long Walk to Finchley (2008), and won critical acclaim for her performances in the Channel 4 miniseries The Devil's Whore (2008) and National Treasure (2016), as well as the BBC One miniseries The Witness for the Prosecution (2016). Her stage credits include August Strindberg's Miss Julie, Shakespeare's Measure for Measure (Theatre Royal, Bath, both 2006) and Anton Chekhov's Ivanov (West End, 2008).\n\nDescription above from the Wikipedia article Andrea Riseborough, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
