    "biography": "Melvin Dimas Rodríguez is an American actor, best known for starring as Nurse Patsy de la Serda on the HBO comedy Getting On, as Todd Rodriguez on the Fox comedy The Last Man on Earth, and as Ernie Gomes on the Showtime drama On Becoming a God in Central Florida. Other notable works include recurring as Marco Pasternak on AMC's Better Call Saul and co-starring on the short-lived Fox sitcoms Running Wilde and Enlisted. In 2021, Rodriguez appeared in the crime television series CSI: Vegas.\n\nRodríguez is most known for his recurring roles as Sgt. Núñez on Community and SPC Chubowski on the Fox sitcom Enlisted. He portrayed Marco Pasternak, the best friend and partner-in-crime of Jimmy McGill in the first and third seasons of Better Call Saul. He had a brief role as Officer Morales in the 2002 film Panic Room, and was a main cast member on The Last Man on Earth (2015). He also appeared as Officer Martinez in Little Miss Sunshine (2006).\n\nDescription above from the Wikipedia article Mel Rodriguez, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
