    "biography": "Nicholas Caradoc Hoult (/hoʊlt/; born 7 December 1989) is an English actor. His filmography includes supporting work in big-budget mainstream productions and starring roles in independent projects in American and British films. He has received several accolades, including nominations for a British Academy Film Award, two Golden Globe Awards, and a Primetime Emmy Award. He was included in Forbes 30 Under 30 in 2012.\n\nHoult performed in local theatre productions as a child. He made his screen debut at age six in the 1996 film Intimate Relations and appeared in several television programs. His breakthrough came with his role in the 2002 comedy-drama About a Boy. He achieved wider recognition for his performance as Tony Stonem in the E4 teen series Skins (2007–2008). His transition to adult roles began with the 2009 drama A Single Man, for which he earned a BAFTA Rising Star Award nomination, and the fantasy film Clash of the Titans (2010). He played the mutant Hank McCoy/Beast in the 2011 superhero film X-Men: First Class, a role he reprised in later installments of the film series.\n\nHoult played the title role in the adventure film Jack the Giant Slayer (2013) and a zombie in the romantic comedy Warm Bodies (2013). He had a supporting role in the action film Mad Max: Fury Road (2015) and starred in a number of independent films before portraying various historical figures such as Robert Harley in the black comedy The Favourite (2018), writer J. R. R. Tolkien in Tolkien (2019), and Peter III in the Hulu comedy-drama series The Great (2020–2023). His work on the latter earned him nominations for two Golden Globes and a Primetime Emmy Award. He has since starred in the black comedy The Menu (2022).\n\nOutside of film, Hoult voiced Elliot in the 2010 action role-playing game Fable III and appeared in the 2009 West End play New Boy. He supports the charitable organisations Teenage Cancer Trust and Christian Aid.\n\nDescription above from the Wikipedia article Nicholas Hoult, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
