    "biography": "Shania Twain, a Canadian country music singer-songwriter and actor, was born on August 29, 1965 as Eilleen Regina Edwards in Windsor, Ontario, Canada. She is one of three daughters of Clarence and Sharon (Morrison) Edwards (sister Jill is two years older and Carrie-Ann three years younger). When she was age six, her mother remarried Jerry Twain, a full-blooded Ojibwa native from Timmins, Ontario, who adopted her as his own. She started out singing in bars as a child after hours, and, at thirteen, appeared on The Tommy Hunter Show (1965). When she was 22, her parents were killed in an accident, and she became the legal guardian of her half-brothers (Mark, then 13, and Darryl, then 14) and sister, putting her musical career on hold to raise her family. In 1991 she changed her name to Shania (meaning \"I'm on my way\" in Ojibwa, it was the name of a co-worker), and signed a contract with Mercury Nashville that same year. Her first album went by without notice, but her second album (produced with Robert John (Mutt) Lange, who she wed on December 28, 1993 and divorced on June 9, 2010) broke world records with its sales! Referred to as \"The Queen of Country Pop,\" she is one of the most commercially successful artists of all time, having sold over 85 million albums. Presently married to Frederic Nicolas Thiebaud on January 1, 2011 - present.",
