    "biography": "Sam Rockwell (born November 5, 1968) is an American actor. He is known for playing distressed police officer Jason Dixon in Martin McDonagh’s crime drama Three Billboards Outside Ebbing, Missouri (2017), for which he won the Academy Award for Best Supporting Actor. He was nominated in the same category the following year for portraying George W. Bush in Adam McKay's political satire Vice (2018). In 2019, he portrayed Bob Fosse in the FX biographical miniseries Fosse/Verdon, earning a nomination for a Primetime Emmy Award, and in 2022, he received a Tony Award nomination for his performance in the Broadway revival of David Mamet's American Buffalo.\n\nRockwell's other films include The Green Mile (1999), Galaxy Quest (1999), Charlie's Angels (2000), Confessions of a Dangerous Mind (2002), Matchstick Men (2003), The Hitchhiker's Guide to the Galaxy (2005), The Assassination of Jesse James by the Coward Robert Ford (2007), Moon (2009), Gentlemen Broncos (2009), Iron Man 2 (2010), Seven Psychopaths (2012), Jojo Rabbit (2019), and See How They Run (2022).\n\nDescription above from the Wikipedia article Sam Rockwell, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
