    "biography": "Judith Therese Evans (born July 20, 1975), known professionally as Judy Greer, is an American actress. She is primarily known as a character actress, who has appeared in a wide variety of films. She first rose to prominence in the late 1990s to early 2000s, appearing in the films Jawbreaker (1999), What Women Want (2000), 13 Going on 30 (2004), 27 Dresses (2008), and Love & Other Drugs (2010). Greer also expanded into other genres, with roles in such films as Adaptation (2002), The Village (2004), The Descendants (2011), Carrie (2013), Dawn of the Planet of the Apes (2014), Jurassic World (2015), Ant-Man (2015), War for the Planet of the Apes (2017), Ant-Man and the Wasp (2018), Halloween (2018), and Halloween Kills (2021). She made her directorial debut with the comedy-drama film A Happening of Monumental Proportions (2017). On television, Greer is best known for her starring voice role as Cheryl Tunt in the FXX animated comedy series Archer (2009–present). She also had roles in the comedy series The Big Bang Theory (2007–2019), Arrested Development (2003–2006, 2013-2019), Two and a Half Men (2003–2015), Married (2014–2015), and Kidding (2018–2020).\n\nDescription above from the Wikipedia article Judy Greer, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
