    "biography": "Demi Lovato (born August 20, 1992) is an American singer-songwriter, musician, and actor. Their earliest roles included a part on Barney & Friends, before they became better known for their starring roles in the Camp Rock movies, as Sonny Munroe in Sonny with a Chance, and as the star of the 2009 movie Princess Protection Program. They are also involved in philanthropic activities through charity work and various social and environmental causes. As a solo musical artist, Lovato released their debut album Don't Forget on September 23, 2008. The album debuted at #2 on the Billboard 200 selling 89,000 copies in the first week. It has since sold over 500,000 records in the United States and got certified Gold by RIAA. Lovato stated in an interview that the album was recorded in ten days. Lovato released their second album, Here We Go Again, on July 21, 2009. The album debuted at #1 on the Billboard 200, selling 108,000 copies in the first week.\n\nDescription above from the Wikipedia Demi Lovato, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
