    "biography": "Allen Kelsey Grammer (born February 21, 1955) is an American actor, comedian, and producer. He gained fame for his role as the psychiatrist Dr. Frasier Crane on the NBC sitcom Cheers (1984–1993) and its spin-off Frasier (1993–2004, and again from 2023–present). At more than 20 years on-air, this is one of the longest-running roles played by a single live-action actor in primetime television history. He has received numerous accolades, including a total of six Emmy Awards, three Golden Globe Awards, a Screen Actors Guild Award, and a Tony Award. \n\nGrammer, having trained as an actor at Juilliard and the Old Globe Theatre, made his professional acting debut as Lennox in the 1981 Broadway revival of Macbeth. The following year, he portrayed Cassio acting opposite Christopher Plummer and James Earl Jones in Othello. In 1983, he acted alongside Mandy Patinkin in the original off-Broadway production of Stephen Sondheim's musical Sunday in the Park with George. He has since starred in the leading roles in productions of both Sweeney Todd: The Demon Barber of Fleet Street and My Fair Lady.\n\nOn film, he is known for his role as Dr. Hank McCoy/BBeast in the superhero films X-Men: The Last Stand (2006), X-Men: Days of Future Past (2014), and The Marvels (2023). His other roles include Down Periscope (1996), The Pentagon Wars (1998), and Swing Vote (2008). He is also known for his voice roles in Anastasia (1997), Toy Story 2 (1999), and as Sideshow Bob in The Simpsons. He took guest roles in the sitcoms 30 Rock, Modern Family, and Unbreakable Kimmy Schmidt. For his performance as the corrupt mayor in the Starz political series Boss (2011–2012), he received a Golden Globe Award for Best Actor—TV Series Drama.\n\nIn 2010, Grammer returned to Broadway in the musical revival of La Cage aux Folles, where he received a nomination for the Tony Award for Best Leading Actor in a Musical. In 2016, Grammer won a Tony Award for Best Musical as producer of a musical revival of The Colour Purple. In 2019, he starred as Don Quixote in a production of Man of La Mancha at the London Coliseum. In 2023, The Telegraph described Grammer as one of \"the finest actors\" of his generation. He was awarded a star on the Hollywood Walk of Fame in 2000.\n\nDescription above from the Wikipedia article Kelsey Grammer, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
