    "biography": "Ariana Greenblatt (born August 27, 2007) is an American actress. Her first starring role was in the Disney Channel comedy series Stuck in the Middle (2016–2018). Other early roles included the comedy film A Bad Moms Christmas (2017), the Marvel film Avengers: Infinity War (2018), and the musical film In the Heights (2021). She rose to greater prominence with the science-fiction film 65, the comedy film Barbie, and the space opera television series Ahsoka, which were all released in 2023. For Barbie, she received nominations at the Critics' Choice and Screen Actors Guild Awards.\n\nGreenblatt was born in New York, New York, on August 27, 2007. Her father, Shon Greenblatt, is an actor, and he and her paternal grandparents are Broadway producers. She is of Ashkenazi Jewish descent through her father, while her mother is Puerto Rican. Greenblatt grew up in New York City and Parkland, Florida.\n\nIn 2016, Greenblatt began her career as a child actress when she was cast in a starring role in the Disney Channel sitcom Stuck in the Middle, playing Daphne, the youngest child in the Diaz family. Her first film role was Lori in A Bad Moms Christmas in 2017. In 2018, Greenblatt played a young Gamora in Avengers: Infinity War. She subsequently appeared in the films In the Heights, The One and Only Ivan, and Love and Monsters.\n\nIn 2020, Greenblatt voiced a young Velma Dinkley in Scoob!, and in 2021, she voiced Tim's eldest daughter Tabitha in The Boss Baby: Family Business, a role which she would reprise in The Boss Baby: Back in the Crib. In 2023, Greenblatt starred as Koa in the science fiction thriller film 65 and appeared as Sasha in the Barbie film and as young Ahsoka Tano in the Ahsoka series on Disney+. She played Tiny Tina in Borderlands, a feature film adaptation of the video game of the same name.\n\nDescription above from the Wikipedia article Ariana Greenblatt, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
