    "biography": "Gabriel Michael Bateman (born September 10, 2004) is an American actor. He is best known for starring in numerous horror films, including as Robert in Annabelle (2014), Martin Wells in Lights Out (2016), Andy Barclay in Child's Play (2019), and Kyle Hunter in Unhinged (2020).  Bateman made his acting debut in 2012, appearing in the film George Biddle, CPA. In 2014, he had a supporting role as Robert in the supernatural horror film Annabelle, a spin-off of the acclaimed horror film The Conjuring. From 2014 to 2015, he starred as Ethan Taylor in the CBS drama thriller series Stalker.\n\nIn November 2014, he was cast in Robert Kirkman's Cinemax horror drama series Outcast. He appeared in the series as Joshua Austin from 2016 to 2017. In 2015, he had guest roles in various television series, including Your Family or Mine, Wicked City, and Code Black. In 2016, Bateman played a leading role, alongside Teresa Palmer, in the supernatural horror film Lights Out, which was produced by James Wan. Also that year, he starred as Jack Hawthorne in the CBS mystery drama series American Gothic, which ran for one season. In 2018, he starred as Carter Hughes in the Netflix family comedy film Benji. He also starred as Wyatt McKenna in the Prime Video comedy drama series The Dangerous Book for Boys.\n\nBateman starred in commercials for Staples, Frigidaire, Energizer EcoAdvanced Recycled Batteries, Iams, and the Cadillac CTS Sedan. He also appeared in two music videos (\"It's a Job\" and \"A New Beginning\") for the album I Remembered But Then I Forgot by Wolfie's Just Fine, a folk music side project of Jon Lajoie.\n\nIn 2019, Bateman received further recognition for starring as Andy Barclay in the horror film Child's Play, alongside Aubrey Plaza. The film was a critical and commercial success. Also that year, he starred as Charlie Brenner in the musical adventure film Playmobil: The Movie and as Scott in the historical war film Robert the Bruce. In 2020, he starred as Oliver Reed in the family film Think Like a Dog and as Kyle Hunter in the thriller film Unhinged, alongside Russell Crowe.",
