    "biography": "Shameik Alti Moore (born May 4, 1995) is an American actor, singer, and rapper, of Jamaican descent.\n\nHe started off with bit roles on shows such as Tyler Perry's House of Payne, Reed Between the Lines, and Joyful Noise. In 2013, he had his first main television role on the sketch-comedy series Incredible Crew, which aired on Cartoon Network before being cancelled after one season.\n\nHe then gained recognition with his portrayal of Malcolm in the 2015 film Dope, which premiered at the 2015 Sundance Film Festival. Indiewire included Moore on its list of \"The 12 Major Breakouts of the 2015 Sundance Film Festival\" for his performance in the movie.\n\nHe is also one of the five male leads in the Netflix series The Get Down, which premiered in 2016 and was cancelled in 2017 after one half-season. He voices Miles Morales / Spider-Man in the animated Spider-Verse film franchise, voicing him both in the 2018 film Spider-Man: Into the Spider-Verse and it's 2023 sequel titled Spider-Man: Across the Spider-Verse. He is slated to voice the character again in the currently undated third film titled Beyond the Spider-Verse.",
