    "biography": "Jesse Plemons (born April 2, 1988) is an American actor. He began his career as a child actor and achieved a breakthrough with his role as Landry Clarke in the NBC drama series Friday Night Lights (2006–2011). He subsequently portrayed Todd Alquist in season 5 of the AMC crime drama series Breaking Bad (2012–2013) and its sequel film El Camino: A Breaking Bad Movie (2019). For his role as Ed Blumquist in season 2 of the FX anthology series Fargo (2015), he received his first Primetime Emmy Award nomination and won a Critics' Choice Television Award. He received a second Emmy nomination for his performance in \"USS Callister\", an episode of the Netflix anthology series Black Mirror (2017). Plemons received his third Emmy nomination for his supporting role in the HBO miniseries Love & Death (2023).\n\nPlemons has appeared in supporting roles in several films, including The Master (2012), Black Mass, Bridge of Spies (both 2015), Game Night, Vice (both 2018), The Irishman (2019), Judas and the Black Messiah, Jungle Cruise, and The Power of the Dog (all in 2021). He has also starred in the psychological thriller I'm Thinking of Ending Things (2020). He was nominated for the Independent Spirit Award for Best Male Lead for his starring role in Other People (2016), and for his performance in The Power of the Dog, he was nominated for a BAFTA Award for Best Actor in a Supporting Role and the Academy Award for Best Supporting Actor.",
