    "biography": "Jessie Buckley is an Irish actress and singer. A Royal Academy of Dramatic Art graduate, she began her career in 2008 as a contestant on the BBC TV talent show I'd Do Anything, in which she came second. The recipient of a Laurence Olivier Award, in addition to nominations for an Academy Award and three BAFTA Awards, she was listed at number 38 on The Irish Times' list of Ireland's greatest film actors of all time, in 2020. Her early onscreen appearances include portrayals in BBC television series, such as Marya Bolkonskaya in the 2016 adaptation of Leo Tolstoy's War and Peace, Lorna Bow in Taboo (2017) and Marian Halcombe in The Woman in White (2018). Buckley made her film debut playing the lead role of Moll Huntford in Beast (2017). Her other roles include Rose-Lynn Harlan in Wild Rose (2018), for which she received a nomination for the BAFTA Award for Best Actress in a Leading Role, Lyudmilla Ignatenko in the HBO miniseries Chernobyl (2019), the Young Woman in I'm Thinking of Ending Things (2020), Oraetta Mayflower in season four of Fargo (2020) and young Leda in The Lost Daughter (2021). Her performance in the latter earned her a nomination for the Academy Award for Best Supporting Actress. In 2019, she was recognized by Forbes in its annual 30 under 30 list. Buckley starred as Sally Bowles in a West End revival of Cabaret in 2021, for which she won the Laurence Olivier Award for Best Actress in a Musical.",
