    "biography": "Jenny Slate (born March 25, 1982) is an American actress, stand-up comedian, and writer. Following early acting and stand-up roles on television, Slate gained recognition for her live variety shows in New York City and for co-creating, writing, and producing the children's short film and book series Marcel the Shell with Shoes On (2010–present). She became more widely known as a cast member on the 35th season of the NBC sketch comedy series Saturday Night Live between 2009 and 2010, followed by subsequent roles in the comedic series Bob's Burgers (2012–present), Parks and Recreation (2013–2015), House of Lies (2013–2015), and Kroll Show (2013–2015).\n\nSlate's breakout role came with her leading performance in the coming-of-age comedy-drama film Obvious Child (2014), for which she won the Critics' Choice Movie Award for Best Actress in a Comedy and was nominated for an Independent Spirit Award and Gotham Independent Film Award. She lent voice performances to the animated films The Lorax (2012), Zootopia (2016), The Secret Life of Pets film franchise (2016–2019), The Lego Batman Movie, and Despicable Me 3 (both 2017), and she ventured into dramatic roles with her supporting performance as Bonnie in Gifted (2017). She also appeared in the critically acclaimed science-fiction film Everything Everywhere All at Once, winning the Screen Actors Guild Award for Outstanding Performance by a Cast in a Motion Picture.\n\nDescription above from the Wikipedia article Jenny Slate, licensed under CC-BY-SA, full list of contributors on Wikipedia.  ",
