    "biography": "Teyonah Parris (/tiˈɒnə/ tee-ON-ə; born September 22, 1987) is an American actress. A graduate of Juilliard School, she began acting in 2010. Her first prominent roles were those of secretary Dawn Chambers in the AMC drama series Mad Men (2012–2015) and a starring role in the 2014 independent film Dear White People. Since then, she has appeared in the drama series Empire (2014), Spike Lee's crime comedy Chi-Raq (2015), and the drama film If Beale Street Could Talk (2018).\n\nIn 2021, Parris starred in the horror film Candyman and began portraying Monica Rambeau in the Marvel Cinematic Universe, starting with the Disney+ series WandaVision.\n\nDescription above from the Wikipedia article Teyonah Parris, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
