    "biography": "Cloris Leachman (April 30, 1926 – January 26, 2021) was an American actress and comedian, whose career spanned over seven decades. She won various accolades, including eight Primetime Emmy Awards from 22 nominations, making her the most nominated and, along with Julia Louis-Dreyfus, most awarded actress in Emmy history. In addition, she won an Academy Award, a British Academy Film Award, a Golden Globe Award, and a Daytime Emmy Award.\n\nLeachman's breakthrough role was the nosy and cunning landlady Phyllis Lindstrom in the landmark CBS sitcom The Mary Tyler Moore Show (1970–75), for which she won the Primetime Emmy Award for Outstanding Supporting Actress in a Comedy Series in 1974 and 1975; its spin-off, Phyllis (1975–77), earned her the Golden Globe Award for Best TV Actress – Musical or Comedy.",
