    "biography": "Victor Jay Garber, OC (born March 16, 1949) is a Canadian actor. Known for his work on stage and screen, he has been nominated for three Gemini Awards, four Tony Awards, and six Primetime Emmy Awards. In 2022, he was made an Officer of the Order of Canada.\n\nGarber is perhaps best known for playing Jesus in Godspell, Jack Bristow in the television series Alias and Thomas Andrews in James Cameron's Titanic. Born in 1949 to Joseph and Hope Garber, Victor discovered his passion for acting early on. Beginning at nine, he honed his craft at the University of Toronto's Hart House, starting a career that spans over four decades. From notable TV roles in \"The Slap,\" \"The Flash,\" and \"Motive\" to acclaimed performances in \"Alias,\" earning three Emmy nods, Victor’s talent extends to the stage, earning four Tony nominations. He’s celebrated for his on-screen presence, sharing in SAG Award nominations for \"Milk\" and \"Titanic\" and winning for \"Argo.\" Beyond acting, he learned officiating to marry Jennifer Garner and Ben Affleck and was the lead singer of the pop group Sugar Shoppe.",
