    "biography": "Colman Jason Domingo (born November 28, 1969) is an American actor, playwright and theater director. Prominent on both screen and stage, he has received various accolades, including a nomination for an Academy Award, a Primetime Emmy Award win, and two nominations for Tony Awards.\n\nDomingo's early Broadway roles include the 2005 play Well and the 2008 musical Passing Strange. He gained acclaim for his role as Mr. Bones in the Broadway musical The Scottsboro Boys (2011), for which he was nominated for the Tony Award for Best Featured Actor in a Musical. He reprised the role in the 2014 West End production, being nominated for the Laurence Olivier Award for Best Performance in a Supporting Role in a Musical. In 2018, he wrote the book for the Broadway musical Summer: The Donna Summer Musical.\n\nAfter early roles in various incarnations of the Law & Order series and as part of the main cast for The Big Gay Sketch Show, he had his breakthrough playing Victor Strand in the AMC series Fear the Walking Dead (2015–2023). In 2022, he won the Primetime Emmy Award for Outstanding Guest Actor in a Drama Series for his performance as the recovering drug addict Ali on the HBO series Euphoria.\n\nDomingo's film appearances include supporting roles in Lincoln (2012), Selma (2014), If Beale Street Could Talk (2018), and Ma Rainey's Black Bottom (2020). For his role as a ruthless pimp in Janicza Bravo's Zola (2021), he was nominated for an Independent Spirit Award for Best Supporting Male. His portrayal of civil rights activist Bayard Rustin in the Netflix film Rustin (2023) earned him nomination for the Academy Award for Best Actor.\n\nDomingo is openly gay, and has been married to his husband, Raúl Domingo, since 2014.",
