    "biography": "Brian Tyree Henry (born March 31, 1982) is an American actor. He is best known for his role as Alfred \"Paper Boi\" Miles in the FX comedy-drama series Atlanta (2016–2022), for which he received a Primetime Emmy Award nomination for Outstanding Supporting Actor in a Comedy Series. He is also known for his performances in Boardwalk Empire, How to Get Away with Murder, and This Is Us.\n\nHenry made his film breakthrough in 2018 with starring roles in Steve McQueen's heist film Widows, Barry Jenkins' romantic drama film If Beale Street Could Talk, and the animated superhero film Spider-Man: Into the Spider-Verse. He's since appeared in Joker (2019), Godzilla vs. Kong (2021), The Woman in the Window (2021), and Bullet Train (2022). He portrayed Phastos in the Marvel Cinematic Universe film Eternals (2021). In 2022, he starred in Causeway (2022) which earned him a nomination for an Academy Award for Best Supporting Actor.\n\nHe has also appeared on stage, making his debut performance in the Shakespeare in the Park production of Romeo and Juliet (2007), and acting in various plays at the Public Theatre, before appearing in the original Broadway cast of The Book of Mormon (2011). In 2014 he appeared in the off-Broadway musical The Fortress of Solitude. For his performance in the 2018 Broadway revival of Kenneth Lonergan's play Lobby Hero, he received a Tony Award nomination for Best Featured Actor in a Play.",
