    "biography": "Santiago Cabrera (born 5 May 1978) is a Chilean actor who has worked mainly in the UK and United States. Cabrera is best known for his roles as the character Isaac Mendez in the NBC superhero drama Heroes, Lancelot in the BBC drama series Merlin, and Aramis in the BBC series The Musketeers. He was also the lead in the CBS drama Salvation as Darius Tanz, and played Captain Cristóbal \"Cris\" Rios in the Paramount+ series Star Trek: Picard.\n\nCabrera was born in Caracas, Venezuela, where his father, a Chilean diplomat, was stationed at the time. He is the middle child of three.[1] Moving along with his father's career, Santiago grew up mainly in England, but also in Romania, Toronto and Madrid.[2] His family returned to Chile when he was fifteen years old. He was captain of his football team in high school,[1] and only tried acting when his teachers encouraged him.[3] He trained at the Drama Centre London from 2000 to 2003.",
