    "biography": "Gemma Chan (born November 29, 1982) is an English actress. Born and raised in London, Chan attended the Newstead Wood School for Girls and studied law at Worcester College, Oxford before choosing to pursue a career in acting instead, enrolling at the Drama Centre London. Chan was subsequently cast in various supporting roles on television, including Doctor Who, Sherlock, Secret Diary of a Call Girl, Fresh Meat, Bedlam and True Love. She also appeared in independent films Exam (2009), Submarine (2010) and Belles Familles (2015). Chan performed in the British premiere of Yellow Face at The Park Theatre and Our Ajax at the Southwark Playhouse.\n\nChan had minor roles in Jack Ryan: Shadow Recruit (2014), Fantastic Beasts and Where to Find Them (2016) and Transformers: The Last Knight (2017). She starred as a servile anthropomorph in sci-fi series Humans (2015–2018) to critical praise. Chan gained widespread recognition for portraying Astrid Leong-Teo in Jon M. Chu's romantic comedy Crazy Rich Asians (2018), which became a critical and commercial hit. Chan along with the ensemble was nominated for the Screen Actors Guild Award for Outstanding Cast in a Motion Picture. Chan played Bess of Hardwick in the historical drama Mary Queen of Scots (2018) and voiced the antagonist Namaari in Disney's animated film Raya and the Last Dragon (2021). In Marvel Studios' Marvel Cinematic Universe (MCU), Chan portrayed Minn-Erva in Captain Marvel (2019) before headlining Eternals (2021) as Sersi.",
