    "biography": "Ariana Grande-Butera (born June 26, 1993) is an American singer, songwriter, and actress. Regarded as a pop icon and an influential figure in popular music, she is noted for her four-octave vocal range and her signature use of the whistle register. Her personal life and music have been the subject of widespread media attention. Grande has received numerous accolades throughout her career, including two Grammy Awards, one Brit Award, one Bambi Award, two Billboard Music Awards, three American Music Awards, nine MTV Video Music Awards, and 30 Guinness World Records. Grande began her music career at age 15 in 2008 Broadway musical 13. She rose to fame for playing Cat Valentine in the Nickelodeon television series Victorious (2010–2013) and Sam & Cat (2013–2014). Grande signed with Republic Records in 2011 after label executives viewed YouTube videos of her covering songs. Her 1950s doo-wop-influenced pop and R&B debut album, Yours Truly (2013), topped the US Billboard 200, while it is the lead single, \"The Way\", reached the top ten of the US Billboard Hot 100.  She continued to explore pop and R&B in her second and third studio albums, My Everything (2014) and Dangerous Woman (2016).  Dangerous Woman became her first of four consecutive number-one albums in the UK. Personal struggles influenced her trap-infused fourth and fifth studio albums, Sweetener (2018) and Thank U, Next (2019). Sweetener won the Grammy Award for Best Pop Vocal Album, and Thank U, Next broke the record for the largest streaming week for a pop album and was nominated for Album of the Year. The singles \"Thank U, Next\", \"7 Rings\", and \"Break Up with Your Girlfriend, I'm Bored\" made Grande the first solo artist to hold the top three spots on the Hot 100 simultaneously and the first woman to succeed herself at the top of the UK Singles Chart. In 2020 Ariana collaborate on \"Rain on Me\" with Lady Gaga who win the Grammy Award for Best Pop Duo/Group Performance. Grande expanded on the trap genre with her sixth studio album, Positions (2020), which both the album and its title track debuted at number one in the UK and the US. Her collaborations with The Weeknd on the remixes of \"Save Your Tears\" and \"Die For You\" garnered her sixth and seventh US number-one singles, respectively. In 2024, she earned another two number one singles with the high anticipated releases of “Yes And?” & We Can’t Be Friends both on  her 7th studio Album “Eternal Sunshine.” She also made her acting return playing Glinda in the broadway adaptation of Wicked: Wicked Part 1.",
