    "biography": "José Pedro Balmaceda Pascal (Spanish: [xoˈseˈpeðɾo βalmaˈseða pasˈkal]; born April 2, 1975) is a Chilean and American actor. After nearly two decades of taking small roles on stage and television, Pascal had his breakout role as Oberyn Martell in the fourth season of the HBO fantasy series Game of Thrones (2014). He gained further prominence with his portrayal of Javier Peña in the Netflix crime series Narcos (2015–2017). He went on to appear in the films The Great Wall (2016), Kingsman: The Golden Circle (2017), The Equaliser 2 (2018), and Triple Frontier (2019).\n\nPascal's leading roles as Din Djarin in the Disney+ science fiction series The Mandalorian (2019–present) and Joel Miller in the HBO post-apocalyptic drama series The Last of Us (2023–present) propelled him to international stardom, earning him a reputation for portraying adoptive father figures. For the latter role, he received numerous accolades, including a Screen Actors Guild Award and a nomination for a Golden Globe Award and Primetime Emmy Award. He took further parental roles in the films We Can Be Heroes (2020) and Strange Way of Life (2023) and as Fink the fox in The Wild Robot (2024). Pascal has also starred in the big-budget films Wonder Woman 1984 (2020) and Gladiator II (2024).\n\nActive in theatre since 1999, he made his Broadway debut as Edmund in a 2019 adaptation of King Lear. Time magazine named him one of the 100 most influential people in the world in 2023, and in 2024, he was polled as Grindr's hottest man of the year.\n\nDescription above from the Wikipedia article Pedro Pascal, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
