    "biography": "Lily Chloe Ninette Thomson (born April 5, 1989), better known by her stage name Lily James, is an English actress. She studied acting at the Guildhall School of Music and Drama in London and began her career in the British television series Just William (2010). Following her role in the period drama series Downton Abbey (2012–2015), her film breakthrough was the title role in Cinderella (2015).\n\nJames went on to portray Countess Natasha Rostova in the television adaptation of War & Peace (2016) and Pamela Anderson in the biographical series Pam & Tommy (2022). The latter earned her an Emmy nomination for Outstanding Lead Actress in a Limited or Anthology Series or Movie in 2022. She has had starring roles in several films, including Pride and Prejudice and Zombies (2016), Baby Driver (2017), Darkest Hour (2017), The Guernsey Literary and Potato Peel Pie Society (2018), the musical Mamma Mia! Here We Go Again (2018), Yesterday (2019), Rebecca (2020) and The Dig (2021).",
