    "biography": "William Shatner (born March 22, 1931) is a Canadian actor, musician, singer, author, film director, spokesman and comedian. He gained worldwide fame and became a cultural icon for his portrayal of Captain James Tiberius Kirk, commander of the Federation starship USS Enterprise, in the science fiction television series Star Trek, from 1966 to 1969; Star Trek: The Animated Series from 1973 to 1974, and in seven of the subsequent Star Trek feature films from 1979 to 1994. He has written a series of books chronicling his experiences playing Captain Kirk and being a part of Star Trek, and has co-written several novels set in the Star Trek universe. He has also authored a series of science fiction novels called TekWar that were adapted for television.\n\nShatner also played the eponymous veteran police sergeant in T. J. Hooker from 1982 to 1986. Afterwards, he hosted the reality-based television series Rescue 911 from 1989 to 1996, which won a People's Choice Award for Favorite New TV Dramatic Series. He has since worked as a musician, author, director and celebrity pitchman. From 2004 to 2008, he starred as attorney Denny Crane in the television dramas The Practice and its spin-off Boston Legal, for which he won two Emmy Awards and a Golden Globe Award.",
