    "biography": "Ruby Rose Langenheim (born 20 March 1986), better known as Ruby Rose, is an Australian model, DJ, recording artist, actress, television presenter, and former MTV VJ. Rose emerged in the media spotlight as a presenter on MTV Australia, followed by several high-profile modelling gigs, notably as the face of Maybelline New York in Australia. In addition to her modelling career, she has co-hosted various television shows, namely Australia's Next Top Model and The Project on Network Ten.\n\nRose pursued a career in acting from 2008 onwards, with her debut performance in the Australian film Suite for Fleur. In 2013, she had a small role in the drama Around the Block. She appeared in seasons three and four of the Netflix series Orange Is the New Black, and received praise for her work. Her personal life has also received attention.",
