    "biography": "Emilia Isobel Euphemia Rose Clarke, MBE (born 23 October 1986), is an English actress. She is best known for her role as Daenerys Targaryen in the HBO fantasy series Game of Thrones (2011–2019), for which she received nominations for four Primetime Emmy Awards. She is also known for playing Sarah Connor in the science fiction film Terminator: Genisys (2015) and Qi'ra in the Star Wars film Solo: A Star Wars Story (2018), as well as starring in the romantic dramas Me Before You (2016) and Last Christmas (2019).\n\nClarke studied at Drama Centre London, appearing in a number of stage productions. Her television debut was a guest appearance in the 2009 BBC One medical soap opera Doctors, at age 22. Clarke made her Broadway debut as Holly Golightly in the play Breakfast at Tiffany's (2013) and played Nina in a West End production of The Seagull that was suspended due to the COVID-19 lockdowns. She also had a role named G'iah in the Marvel Cinematic Universe miniseries, Secret Invasion (2023).\n\nDescription above from the Wikipedia article Emilia Clarke, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
