    "biography": "Edward James Begley Jr. (born September 16, 1949) is an American actor and environmental activist. He has appeared in hundreds of films, television shows, and stage performances. He played Dr. Victor Ehrlich on the television series St. Elsewhere (1982–1988). The role earned him six consecutive Primetime Emmy Award nominations and a Golden Globe Award nomination. He also co-hosted, along with wife Rachelle Carson, the green living reality show titled Living with Ed (2007–2010).\n\nEqually prolific in cinema, Begley's film appearances include Blue Collar (1978), An Officer and a Gentleman (1982), This Is Spinal Tap (1984), Transylvania 6-5000 (1985), The Accidental Tourist (1988), Scenes from the Class Struggle in Beverly Hills (1989), She-Devil (1989), Batman Forever (1995), and Pineapple Express (2008). He is a recurring cast member in the mockumentaries of Christopher Guest and Eugene Levy, including Best in Show (2000), A Mighty Wind (2003), For Your Consideration (2006), and Mascots (2016).  Description above from the Wikipedia article Ed Begley Jr., licensed under CC-BY-SA, full list of contributors on Wikipedia.",
