    "biography": "Marina Massironi (Legnano, 16 maggio 1963) è un'attrice, comica e doppiatrice italiana di teatro, cinema e televisione, nota anche per essere stata spalla di scena del trio Aldo, Giovanni e Giacomo.\n\nIniziò gli studi di recitazione alla fine del 1982 ed ebbe le sue prime scritture teatrali circa due anni dopo. Nel frattempo sposatasi con Giacomo Poretti, intraprese con questi l'attività cabarettistica, creando il duo noto con il nome di Hansel &amp; Strüdel. Il divorzio da Poretti non cessò tuttavia la collaborazione artistica con l'attore, nel frattempo divenuto parte del trio Aldo, Giovanni e Giacomo: a partire dagli anni novanta Marina Massironi ha collaborato con il trio sia in televisione, sia al cinema che, infine, al teatro. Infatti il suo film d'esordio fu in loro compagnia in Tre uomini e una gamba, partecipando successivamente a Così è la vita e Chiedimi se sono felice. Nel 1998 recita in Fuori dal mondo con Margherita Buy e nel 2000 vince sia il Nastro d'Argento sia il David di Donatello come migliore attrice non protagonista per Pane e tulipani.\n\nAttualmente vive tra Roma e Milano.",
