    "biography": "Ángeles Cruz is a Mexican actress, screenwriter and filmmaker. Originally from La Mixteca area in Oaxaca, she has a degree in acting from the School of Theater Art of the National Institute of Fine Arts. She has participated as an actress in more than a dozen national and international feature films with directors such as Ignacio Ortiz, Jorge Pérez Solano and Francisco Vargas among others. Her work in \"Tamara y la Catarina\" of Lucía Carreras, earned her the \"Colón de Plata\" as Best Actress awarded by the \"Festival de Cine Iberoamericano de Huelva\" 2017 and was \"Nominated for Ariel\" for best female performance in 2018. It was \"Nominated for the Golden Beetle\" as Best Actress by the Swedish Film Academy for her work in the film \"La hija del puma\"(Ulf Hulberg, 1994) and in 2000 for Ariel as best female co-acting for the film \"Rito Terminal\" (Óscar Urrutia, 2000). Her work as a screenwriter and director has produced three award-winning short films: \"La tiricia or como curar la tristeza\", \"La carta\" and \"Arcángel\". Her first feature film \"Nudo mixteco\" will be released soon.",
