    "biography": "Raymond Andrew Winstone (born February 19, 1957) is an English television, stage, film, and voice-over actor with a career spanning five decades. Having worked with many prominent directors, including Martin Scorsese and Steven Spielberg, he is perhaps best known for his \"tough guy\" roles (usually delivered in his distinctive London accent), beginning with that of Carlin in the 1979 film Scum, and Will Scarlet in the cult TV adventure series Robin of Sherwood.\n\nHis film résumé includes Fool's Gold, Cold Mountain, King Arthur, The Proposition, The Departed, Beowulf, Indiana Jones and the Kingdom of the Crystal Skull, and Edge of Darkness. He is known for starring in very profane and violent films such as Nil By Mouth, Sexy Beast and 44 Inch Chest. He has also branched out into film production.  Description above from the Wikipedia article Ray Winstone, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
