    "biography": "Audra Ann McDonald is an American actress and singer. Primarily known for her work on the Broadway stage, she has won six Tony Awards, more performance wins than any other actor, and is the only person to win in all four acting categories. She has performed in musicals, operas, and dramas such as A Moon for the Misbegotten, 110 in the Shade, Carousel, Ragtime, Master Class, and Porgy and Bess. In addition to her six Tony Awards, she has received numerous accolades including two Grammy Awards and an Emmy Award. She was honored with the National Medal of Arts in 2016 from President Barack Obama and was inducted into the American Theater Hall of Fame in 2017.",
