    "biography": "Angeliki Papoulia was born in Athens, Greece. She graduated from Athens University (Theatre Studies) and the \"Empros\" Theatre Drama School in 2000. She speaks English and French. She has starred in the following films: Matchbox (Kiki) Dir. Yiannis Economides 2002. Dogtooth (Older daughter) Dir. Yorgos Lanthimos which won the \"Prix Un Certain Regard\" at the 2009 Cannes Film Festival and was nominated for an Academy Award (Best Foreign Language Film) at the 83rd Academy Awards in 2011. Alps (Nurse) Dir. Yorgos Lanthimos which won the Osella for Best Screenplay at the 68th Venice International Film Festival in 2011. A Blast (Maria) Dir. Syllas Tzoumerkas which had its premiere in Locarno Film Festival in 2014. The Lobster (Heartless Woman) Dir. Yorgos Lanthimos which won The Jury Prize at the 2015 Cannes Film Festival and was nominated for Best Original Screenplay at the 89th Academy Awards. The miracle of the Sargasso Sea (Elisabeth) Dir. Syllas Tzoumerkas which had its premiere at the Berlinale 2019 Film Festival. Amulet (woman) Dir. Romola Garai will have its premiere at Sundance Film Festival 2020. Green Sea (Anna) Dir. Angeliki Antoniou 2018. For her role in Dogtooth, she was awarded with Heart of Sarajevo for Best Actress at the Sarajevo Film Festival 2009. In 2004, she co-founded the blitz theatre group (www.theblitz.gr). She has written, directed and acted in all the group's performances until the most recent in 2017. The group has presented its performances in various important Festivals and Theatres in France (Festival d'Avignon, Theatre de la Ville, La Comedie de Reims), The Netherlands, Germany (Schaubuhne Theatre, Thalia Theatre), Italy, Belgium, Poland, Austria, Norway, Greece (Athens and Epidaurus Festival, Onassis Cultural Center), Turkey, Lebanon. Lately she has co-directed theatre performances at Luzerner Theater in Luzern / Switzerland with Christos Passalis. She has also appeared in performances directed by Michael Marmarinos, Lefteris Vogiatzis, as well as Greek National Theatre productions directed by Yorgos Houvardas and Yorgos Lanthimos.",
