    "biography": "Paris-Michael Katherine Jackson is an American model, actress and musician. Jackson was born on April 3, 1998, at Spaulding Pain Medical Clinic in Beverly Hills, California, and was named after the French capital city in which she was conceived. She is the middle child and only daughter of singer Michael Jackson and younger child of Debbie Rowe. She has one older brother, Michael Joseph Jackson, Jr. often called “Prince”, and one younger half-brother, Prince Michael Jackson often called \"Blanket\". Jackson was raised solely by her father, who received full custody rights following his divorce in 1999; Rowe had stated it was her intention and agreed upon with Michael that he would raise and have custody of the children. Reports alleged that the relationship was an \"economic\" transaction for Rowe while Jackson wanted a baby. She grew up at Neverland Ranch with her siblings. Her father made Elizabeth Taylor and Macaulay Culkin the godparents of her and her brother Prince. During her childhood, she and her siblings often wore masks during public outings with their father to hide their faces from the public. Jackson's father, Michael Joseph Jackson, unexpectedly died on June 25th. 2009, leaving her and her siblings in the custody of their grandmother.\n\nIn 2010, Jackson and her brothers gave an interview for Oprah Winfrey alongside their grandmother Katherine and their cousins about life after her father's death. She and her brother Prince also accepted the Lifetime Achievement Award at the 2010 Grammy Awards on their father's behalf. She and her brother Prince enrolled at the Buckley School, an exclusive private school in Sherman Oaks, California. There, she participated in flag football, softball, and cheerleading.\n\nIn 2011, Jackson signed on to star in the children's fantasy film, Lundon's Bridge and the Three Keys, a story adapted from a book written by Dennis Christen. Ultimately, the film was not produced. In January 2017, Jackson appeared on the cover of Rolling Stone. In March 2017, Jackson signed a modeling contract with IMG Models. The same month she made her acting debut with a guest starring role on FOX's Star.\n\nJackson made her feature film debut in Gringo in 2018.\n\nThis page is based on a Wikipedia article written by contributors. Text is available under the CC BY-SA 4.0 license; additional terms may apply.",
