    "biography": "Meredith Kathleen Hagner is an American actress. She began her career portraying Liberty Ciccone on the CBS soap opera As the World Turns (2008–2010), which earned her a Daytime Emmy Award nomination for Outstanding Younger Actress in a Drama Series in 2009. Following her departure from As the World Turns, she appeared as a series regular on the FX drama Lights Out (2011) and the TBS sitcom Men at Work (2012–2014).\n\nHagner gained further prominence for her role as Portia Davenport in the TBS and HBO Max dark comedy series Search Party (2016–2022), receiving critical praise for her performance. She also appeared as a series regular on the Facebook Watch comedy-drama Strangers (2017–2018), the Quibi comedy Dummy (2020) and Apple TV's Bad Monkey (2024). Hagner's film roles include Hits (2014), Folk Hero & Funny Guy (2016), The Oath (2018), Brightburn (2019), and Palm Springs (2020).",
