    "biography": "Edward Nathan George Jr. (born September 24, 1973) is an American football coach and former player who is the current head football coach at Tennessee State University. He played as a running back in the National Football League (NFL) for nine seasons, primarily for the Houston / Tennessee Oilers / Titans franchise. He was inducted into the College Football Hall of Fame in 2011 as a player, and the International Sports Hall of Fame in 2020.\n\nHe played college football for the Ohio State Buckeyes and won the Heisman Trophy in 1995. He was drafted in the first round of the 1996 NFL draft, and played professionally for the Tennessee Titans (both in Tennessee and in Houston when the franchise was known as the Houston Oilers) and Dallas Cowboys.\n\nPost-football, he earned an MBA from Northwestern University's Kellogg School of Management. In 2016, he appeared on Broadway in the musical Chicago as the hustling lawyer Billy Flynn.\n\nHis jersey was retired by the Titans during a halftime ceremony against the Indianapolis Colts on September 15, 2019.\n\nHe also owns a restaurant in Columbus called Eddie George Bar and Grille 27.\n\nIn 2004, he married American singer, rapper, actress, and author Tamara 'Taj' Johnson.\n\n​From Wikipedia, the free encyclopedia.",
