    "biography": "Krysten Alyce Ritter (born December 16, 1981) is an American actress, director, musician, author, and model. She came to prominence when she appeared as Jane Margolis in the AMC drama series Breaking Bad from 2009 to 2010. She then had the title (and lead) role in two series: Chloe in the ABC sitcom Don't Trust the B---- in Apartment 23 (2012–2013), and superhero Jessica Jones in the Netflix series Jessica Jones (2015–2019). She also appeared as Jessica Jones in the 2017 miniseries The Defenders, and reprised her role as Jane Margolis in the 2019 Breaking Bad spinoff TV film El Camino. Ritter also had a supporting role in the HBO miniseries Love & Death (2023).\n\nRitter has also appeared in the television series Veronica Mars, Gilmore Girls, 'Til Death and Gravity. She appeared in the films What Happens in Vegas (2008), Confessions of a Shopaholic (2009), She's Out of My League (2010), Veronica Mars (2014), Big Eyes (2014), and The Hero (2017).",
