    "biography": "Timothy David Olyphant (born May 20, 1968) is an American actor. He made his acting debut in an off-Broadway theater in 1995, in The Monogamist, and won the Theatre World Award for his performance, and then originated David Sedaris' The Santaland Diaries in 1996. He then branched out to film; in the early years of his career, he was often cast in supporting villainous roles, most notably in Scream 2 (1997), Go (1999), A Man Apart (2003), Gone in 60 Seconds (2000), and The Girl Next Door (2004).\n\nHe came to the attention of a wider audience with his portrayal of Sheriff Seth Bullock in HBO's western Deadwood (2004–2006). He had starring roles in such films as Catch and Release (2006), Hitman (2007), A Perfect Getaway (2009), and The Crazies (2010), and he played the main antagonist, Thomas Gabriel, in Live Free or Die Hard (2007).  In 2020, he played himself in a brief cameo, parodying his Justified character, in the NBC award-winning show The Good Place. In the same year, he guest starred in season 10 of Curb Your Enthusiasm, as well as in the fourth season of Fargo and the second season of The Mandalorian in the episode \"Chapter 9: The Marshal\" as Cobb Vanth, a role he later reprised in The Book of Boba Fett.",
