    "biography": "Tracy Darrell \"Trace\" Adkins (born January 13, 1962) is an American country music artist. He made his debut in 1996 with the album Dreamin' Out Loud, released on Capitol Records Nashville. Since then, Adkins has released seven more studio albums and two Greatest Hits compilations. In addition, he has charted more than twenty singles on the Billboard country music charts, including the Number One hits \"(This Ain't) No Thinkin' Thing\", \"Ladies Love Country Boys\", and \"You're Gonna Miss This\", which peaked in 1997, 2007, and 2008, respectively. \"I Left Something Turned on at Home\" went to #1 on Canada's country chart. All but one of his studio albums have received gold or platinum certification in the United States; his highest-selling to date is 2005's Songs About Me, which has been certified 2× Multi-Platinum for shipping two million copies.\n\nHe has also made several appearances on television, including as a panelist on the game shows Hollywood Squares and Pyramid, as a finalist on The Celebrity Apprentice, as the voice for recurring character Elvin on King of the Hill, and in television commercial voice-overs for the KFC restaurant chain. In addition, Adkins has written an autobiography entitled A Personal Stand: Observations and Opinions from a Free-Thinking Roughneck, which was released in late 2007.\n\nDescription above from the Wikipedia article Trace Adkins, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
