    "biography": "Lashana Rasheda Lynch (born 27 November 1987) is a British actress. She is best known for playing the role of Rosaline Capulet in the ABC period drama series Still Star-Crossed (2017) and fighter pilot Maria Rambeau in Captain Marvel (2019).\n\nLynch made her film debut in the 2012 drama film Fast Girls. She later co-starred in the BBC television film The 7.39. On television, she has appeared in Silent Witness and Death in Paradise and was a regular cast member on the short-lived BBC comedy Crims in 2015. In 2016, Lynch was cast as leading character Rosaline Capulet in the American period drama series Still Star-Crossed, produced by Shonda Rhimes. In 2018, she joined the cast of Y as Agent 355. In 2019, she played fighter pilot Maria Rambeau in the Marvel Cinematic Universe film Captain Marvel. She has been cast as Nomi in the James Bond film No Time to Die, due for release in November 2020.\n\nDescription above is from the Wikipedia article Lashana Lynch, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
