    "biography": "Stefani Joanne Angelina Germanotta (born March 28, 1986), better known by her stage name Lady Gaga, is an American singer and songwriter. After performing in the rock music scene of New York City's Lower East Side in 2003 and later enrolling at New York University's Tisch School of the Arts, she soon signed with Streamline Records, an imprint of Interscope Records. During her early time at Interscope, she worked as a songwriter for fellow label artists and captured the attention of recording artist Akon, who recognized her vocal abilities, and signed her to his own label, Kon Live Distribution.\n\nHaving sold 170 million records as of 2018, Gaga is one of the world's best-selling music artists and the only female artist to achieve four singles that sold at least 10 million copies globally. Her accolades include 13 Grammy Awards, 18 MTV Video Music Awards, 16 Guinness World Records, awards from the Songwriters Hall of Fame and the Council of Fashion Designers of America, and recognition as Billboard's Artist of the Year (2010) and Woman of the Year (2015). She has also been included in several Forbes' power rankings and ranked fourth on VH1's Greatest Women in Music (2012). Time magazine named her one of the 100 most influential people in the world in 2010 and 2019 and placed her on their All-Time 100 Fashion Icons list.",
