    "biography": "Tim Minchin is an Australian musician, actor, comedian and writer. He has been performing his unique brand of musical comedy in front of appropriately excitable and ever growing audiences since starting out in South Melbourne’s Butterfly Club in 2005. He won the Director’s Award at the Melbourne International Comedy Festival for his break-out show Darkside, and followed this later the same year with one of the most successful debut acts ever at the Edinburgh Fringe – winning the\n\nPerrier Award for Best Newcomer. Without wanting to go on and on about it, he’s done some pretty successful live shows since then, often in Australia or the UK, but also on the North American continent (yes that includes you too Canada). But not you Guatemala. Maybe one day.  His current songs span topics such as environmentalism, rationalism, prejudice(ism) and his amour de boobs(ism). In fact it would hardly be over the top to say that his love of boobs would be up there in the back of Plato’s cave in the bit that’s carved out for the most perfect and complete example of the love of boobs. But not in a weird way. During his shows he plays the piano, always nicely and oftentimes wildly and excitingly, whilst looking wonderfully athletic, in a pair of delightfully uncomfortable skinny jeans.  Tim has made many TV appearances: most recently on Good News Week in Australia and Friday Night with Jonathan Ross in the UK. He’s also performed on radio; his most recent project being Strings, a brand new comedy sitcom pilot for BBC Radio 2, which he both wrote and starred in. His acclaimed 9-minute beat poem, Storm, is being animated for release in October. Tim is currently writing the music and lyrics for the musical Matilda with the Royal Shakespeare Company. This adaptation of the Roald Dahl classic opens in Stratford-upon-Avon in November 2010.  Tim, his wife and two young children, now live in London.",
