    "biography": "Bertie Carvel is a British actor who has twice won a Laurence Olivier Award: for Best Actor in a Leading Role in a Musical for his role as Miss Trunchbull in Matilda the Musical, and for Best Actor in a Supporting Role for his performance as Rupert Murdoch in Ink. For the latter role, he won the Tony Award for Best Actor in a Featured Role in a Play.\n\nCarvel was born in Marylebone, London, England, on September 6, 1977. He studied English at the University of Sussex and then trained at the Royal Academy of Dramatic Art. After graduating from RADA in 2003, he began his professional acting career in the theatre.\n\nCarvel has appeared in numerous stage productions, both in the UK and the US. He has won numerous awards for his stage work, including two Laurence Olivier Awards, a Tony Award, and a Drama Desk Award. Some of his most notable stage roles include Miss Trunchbull in Matilda the Musical, Rupert Murdoch in Ink, and Jonathan Strange in Jonathan Strange & Mr Norrell.\n\nIn addition to his stage work, Carvel has also appeared in a number of television and film productions. Some of his most notable TV roles include Simon Foster in Doctor Foster, Adam Dalgliesh in Dalgliesh, and Thewlis in The Sister. He has also appeared in films such as The History Boys, The Woman in Black, and The Thick of It.",
