    "biography": "Robert Ray Wisdom is an American actor, best known for his roles as Howard \"Bunny\" Colvin in the HBO drama series The Wire, Norman \"Lechero\" St. John in the Fox drama series Prison Break, and Harold Conway in the 2021 Hulu comedy film Vacation Friends.  Wisdom was born in Washington, D.C., to Jamaican parents. He graduated from Columbia University with a degree in history and economics. He worked as a producer for NPR's All Things Considered before pursuing a career in acting. Wisdom has appeared in numerous films and television shows, including That Thing You Do!, Face/Off, Ray, The Manchurian Candidate, and The Good Wife. He has also had recurring roles on the television series The Practice, NYPD Blue, and The Shield. In 2012, Wisdom was cast as a series regular in the ABC drama series Nashville. He played the role of Coleman Carlisle, a music producer. The show ran for four seasons. In 2021, Wisdom starred in the Hulu comedy film Vacation Friends. He played the role of Harold Conway, a couple's therapist who becomes involved in a wild weekend with two other couples. The film was a critical and commercial success. Wisdom is a versatile actor who has played a wide range of roles. He is a respected member of the acting community and has won numerous awards for his work, including a NAACP Image Award and a Screen Actors Guild Award.",
