    "biography": "A recent graduate from the Royal Academy of Dramatic Art (RADA), where he trained on a full scholarship, emerging actor Tom Lewis is already starting to make an undeniable mark with his captivating performances across film, television and theatre.\n\nIn his feature film debut, Tom starred as the lead of Redeeming Love, Universal Pictures adaptation from director D.J. Caruso of the international best-selling novel, released in 2022. Set during the 1850s California Gold Rush, the romantic epic is a tale of hope, longing and second chances.\n\nWhilst still in training at RADA, Tom was cast in his breakout role in the HBO phenomenon Gentleman Jack opposite Suranne Jones. Other notable on screen credits include: the critically acclaimed AMC series A Discovery of Witches and voicing roles in Ubisoft's pioneering video game Assassin's Creed: Valhalla.",
