    "biography": "Two-Time Broadway Award Winning Actor/Singer Gabriel Burrafato, has performed starring roles on Broadway, Las Vegas and International stages around the world. Known as the \"Trilingual, Triple Threat\", this powerhouse of a performers has appeared as a recurring guest star in FX's hit show \"You're The Worst\". Other television appearances include ABC's \"Switched at Birth\", CBS's \"Criminal Minds\", Nickelodeon and many other principle leading roles in feature films and television. His televised PBS concert \"Live from the Venetian in Las Vegas\", has aired in over 350 PBS stations across North America. Gabriel has had the honor of working closely with the best in the industry, including 2-time Academy Award winning composer A.R. Rahman, 21-time Tony Award winning Broadway director Harold Prince, and the legendary Sir Andrew Lloyd.\n\nGabriel made his Broadway debut in Sir Andrew Lloyd Webber's Bombay Dreams. He also starred as Lancelot in the Broadway National Tour of Camelot and Magaldi in the Broadway National tour of Evita (Harold Prince Revival). Gabriel had the distinguished honor of originating the role of the elf archer Legolas in the $30 Million Dollar, world premier production of The Lord of The Rings, directed by Tony award winning director Matthew Warchus. Other roles include Dean Martin in the original Las Vegas Production of \"Vegas! The Show\", at Planet Hollywood Resort and Casino, and Lun Tha in the world renowned Stratford Festivals production of The King and I.\n\nGabriel has studied voice at the Royal Conservatory of Music in Toronto and began his career as an Apprentice Actor at the prestigious Shaw Festival of Canada. Off stage, Gabriel is the Creative Director and Photographer of his wife's very successful lifestyle blog, www.MamaInHeels.com. But his most exciting role of all is being a dad to his twin boys :-)\n\nwww.GabrielBurrafato.com",
