    "biography": "Paul Benjamin Mendelsohn (born 3 April 1969) is an Australian actor. He first rose to prominence in Australia for his break-out role in The Year My Voice Broke (1987). He gained international attention for his starring role in the crime drama Animal Kingdom (2010). He has since had roles in films such as The Dark Knight Rises (2012), Starred Up (2013), Lost River (2014), Mississippi Grind (2015), Rogue One (2016), Darkest Hour (2017), and Ready Player One (2018).\n\nMendelsohn starred in the Netflix drama series Bloodline (2015–2017), for which he won the Primetime Emmy Award for Outstanding Supporting Actor in a Drama Series in 2016. He played the Sheriff of Nottingham in Robin Hood (2018). He joined the Marvel Cinematic Universe as Talos in the superhero film Captain Marvel (2019) and the Disney+ series Secret Invasion (2023). He has also starred in the HBO crime miniseries The Outsider (2020). In 2024, he began portraying fashion designer Christian Diorin the television series The New Look.\n\nDescription above from the Wikipedia article Ben Mendelsohn, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
