    "biography": "David Anthony Mann Sr. (born August 7, 1966) is an American actor and gospel singer who has starred in several Tyler Perry plays including I Can Do Bad All By Myself, Madea's Family Reunion, Madea's Class Reunion, Meet the Browns, What's Done in the Dark, and Madea's Farewell Play. His character Mr. (Leroy) Brown is the father of Madea's daughter Cora (played by his real life wife, Tamela Mann). He reprised his role in the Tyler Perry films Meet the Browns, Madea Goes to Jail, Madea's Big Happy Family, and A Madea Homecoming, as well as the TBS sitcom spinoff Meet the Browns. He and his wife also starred in the Bounce Network sitcom Mann and Wife. He voices Mr. Nezzer on TBN's .The VeggieTales Show.\n\nHe has been married to actress/singer Tamela Mann since 1988; they were both previous members of Kirk Franklin's vocal ensemble \"The Family\" before working with Tyler Perry. In 2018, he and Tamela recorded a romantic soul album together called Us Against the World.",
