    "biography": "AnnaLynne McCord (born July 16, 1987) is an American actress. Known for playing a range of vixen-type roles, McCord first gained prominence in 2007 as the scheming Eden Lord on the FX television series Nip/Tuck, and as the pampered Loren Wakefield on the MyNetworkTV telenovela American Heiress. In film, she has appeared in the action feature Transporter 2, as well as the thriller Day of the Dead. In 2008, she was the second actor to be cast in the CW series 90210, portraying antiheroine Naomi Clark. Initially, the part of Clark was conceived as a supporting role. By the end of the first season, however, various media outlets had begun referring to McCord as the series' lead.\n\nApart from acting, she has also contributed to charities in her free time, and has been labeled by the Look to the Stars organization as \"one of the strongest young female philanthropists standing up in Hollywood and fighting for the charities she believes in.\" In 2009, McCord was nominated for a Teen Choice Award, and received the Hollywood Life Young Hollywood Superstar of Tomorrow award. For the role of Naomi Clark, she won a Breakthrough of the Year Award in the category of \"Breakthrough Standout Performance\" in 2010.\n\nDescription above from the Wikipedia article AnnaLynne McCord, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
