    "biography": "Harold Torres (Born March 15, 1991 at Mexico City,) is a Mexican actor, known for his performances in the leading roles in the television series Run Coyote Run broadcast on the FX channel and ZeroZeroZero. Harold Torres graduated from a BFA in acting at the Centro Universitario de Teatro (CUT or University Theater Center) at the UNAM (Mexico's National Autonomous University). He has participated in more than 30 feature films amongst them are Norteado, La Cebra, González falsos profetas, Espiral, Los Bañistas and Colosio el Asesinato. For television, he has participated in La ruta blanca for Imagen TV, Niño Santo and Crónica de castas for Canal Once, Texas Rising for the History Channel and Run Coyote Run and Sitiados Mexico for Fox, as well as Ingobernable for Netflix. He has been directed by María Novaro, Everardo Gout, Carlos Bolado and Julián Hernández, Marcel Sisniega, Nicolás Pereda and Rodrigo Plá. He was selected to participate at the Berlinale Talent Campus in 2011 and has been nominated in three occasions for the Ariel award as best actor in Norteado by Rigoberto Perezcano (2010) González falsos Profetas by Cristian Díaz Pardo (2014) and La Carga by Alan Jonsson (2015). In 2009 he was awarded as best actor at the Bratislava Film Festival for Norteado, and at the Morelia International Film Festival for González, falsos profetas for which he also won a Diosa de Plata award in 2015 for best actor.",
