    "biography": "Chloe Rose Fineman (born July 20, 1988) is an American actress, writer, and comedian. She became a featured player on Saturday Night Live starting in its 45th season in September 2019. She was promoted to repertory status in 2021 at the beginning of season 47.\n\nAfter graduating from college, Fineman moved to Los Angeles, where she performed in The Groundlings troupe's Sunday Company. She also performed in \"Characters Welcome\" at the Upright Citizens Brigade Theatre. In 2018, she was recognized as a \"New Face\" at the Just for Laughs festival in Montreal, and she was nominated for Best Comedian at the 2019 Shorty Awards. Her television appearances include Jane the Virgin and Search Party.  She maintains an online presence known in particular for her celebrity impressions in front-facing camera comedy videos. On Instagram, she has posted celebrity impressions as well as clips from her Groundlings work and stand-up comedy. On YouTube, she has done character impressions. In 2018, Vulture critic Luke Kelly-Clyne wrote that after seeing Fineman do impressions of Meryl Streep and others, \"As I found out, that extra bit of genius she possesses – that intangible thing that takes a good impression to a great impression – is rooted in her ability to create entirely original characters who feel as real as anyone you've ever met,\" concluding, \"Chloe Fineman is absolutely one of the most talented new performers right now, and she's long overdue for a break.\"",
