    "biography": "Lena Dunham (born May 13, 1986) is an American writer, director, actress, and producer. She is known as the creator, writer, and star of the HBO television series Girls (2012–2017), for which she received several Emmy Award nominations and two Golden Globe Awards. Dunham also directed several episodes of Girls and became the first woman to win the Directors Guild of America Award for Outstanding Directing – Comedy Series. Prior to Girls, Dunham wrote, directed, and starred in the semi-autobiographical independent film Tiny Furniture (2010), for which she won an Independent Spirit Award for Best First Screenplay. Her second feature film, Sharp Stick, written and directed by Dunham, was released in 2022. Her third film, Catherine Called Birdy, had its world premiere at the Toronto International Film Festival on September 12, 2022. It was released in a limited release on September 23, 2022, by Amazon Studios, prior to streaming on Prime Video on October 7, 2022.\n\nIn 2013, Dunham was included in the annual Time 100 list of the most influential people in the world. In 2014, Dunham released her first book, Not That Kind of Girl: A Young Woman Tells You What She's \"Learned\". In 2015, along with Girls showrunner Jenni Konner, Dunham created the publication Lenny Letter, a feminist online newsletter. The publication ran for three years before folding in late 2018.\n\nDunham briefly appeared in films such as Supporting Characters and This Is 40 (both 2012) and Happy Christmas (2014). She voiced Mary in the 2016 film My Entire High School Sinking Into the Sea, which premiered at the Toronto International Film Festival. On television, aside from Girls, she has played guest roles in Scandal and The Simpsons (both 2015). In 2017, she portrayed Valerie Solanas in American Horror Story: Cult.",
