    "biography": "Hannah Waddingham (born 28 July 1974) is a British actress and singer. She is best known for playing Rebecca Welton in the comedy series Ted Lasso (2020–present), for which she won the Primetime Emmy Award for Outstanding Supporting Actress in a Comedy Series in 2021 and the Critics' Choice Television Award for Best Supporting Actress in a Comedy Series in 2021 and 2022. She has also appeared in a number of West End shows, including Spamalot, the 2010 Regent's Park revival of Into the Woods, and The Wizard of Oz as the Wicked Witch of the West; and has received three Olivier Award nominations for her work.\n\nHer other work includes appearing as an ensemble member in the 2012 film adaptation of Les Misérables, and joining the cast of the fifth season of the HBO series Game of Thrones as Septa Unella in 2015. She co-starred in the 2018 British psychological thriller Winter Ridge, and has had a supporting role on the series Sex Education since 2019.\n\nDescription above from the Wikipedia article Hannah Waddingham, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
