    "biography": "David Wilmot is an award-winning Irish stage, screen, and television actor. Wilmot's theatre credits include Six Characters in Search of an Author at the Abbey Theatre in Dublin, As You Like It with the Druid Theatre Company in Galway, and Juno and the Paycock in London's West End. He originated the role of Padraic in The Lieutenant of Inishmore at The Other Place in Stratford-upon-Avon in 2001, played it at the Barbican Center in 2002, then joined the 2006 off-Broadway Atlantic Theater Company production, which later transferred to Broadway. He was nominated for the 2006 Tony Award for Best Performance by a Leading Actor in a Play, the Drama League Award for Distinguished Performance, and the Outer Critics Circle Award for Outstanding Actor in a Play and won the Lucille Lortel Award for Outstanding Lead Actor and the Theatre World Award for his performance.\n\nWilmot portrayed Dr. Ed Costello in sixteen episopdes of The Clinic on RTÉ. He was nominated for the Irish Film and Television Award for Best Actor in a TV Drama. Wilmot's screen credits include Michael Collins (1996), I Went Down (1997), The Devil's Own (1997), The Tale of Sweeney Todd (1998), Intermission (2003), Laws of Attraction (2004), King Arthur (2004), and Six Shooter (2006). He was named Best Supporting Actor in Film and nominated Best New Talent for Intermission at the 2003 Irish Film and Television Awards.\n\nDescription above from the Wikipedia article David Wilmot, licensed under CC-BY-SA, full list of contributors on Wikipedia.​",
