    "biography": "Benjamin Aldridge (born November 12, 1985) is an English actor, born in Devon. After years with the National Youth Theatre, Ben graduated from the London Academy of Music and Dramatic Art with a bursary from the Genesis Foundation for young actors. He left early to begin filming his television debut alongside Ray Winstone and Parminder Nagra in Compulsion. He is notable for his role as Harry Fanshawe, husband of the title character in the 2008'Channel 4's critically acclaimed Civil War epic The Devil's Whore. He was selected by Screen International's 2008 \"Stars of Tomorrow\". As well as roles in First Light, Lewis, Toast and Vera, Ben also appeared as Daniel Parish in the BBC's period drama Lark Rise to Candleford. In 2011 the American network The CW cast Ben as the lead in their Pilot \"Heavenly\". Later on he spent time in Belgrade shooting the partially improvised love story \"In the night\" for director Ivana Bobic and award winning cinematographer Rain Li, alongside supermodel Daniela Dimitrovska. In September 2014, he joined BBC Original British Drama Our Girl as Captain Charles James. Ben is a co-founder of \"In the Corner Productions\". ",
