    "biography": "Miranda Jane Richardson (born 3 March 1958) is an English actor. She made her film debut playing Ruth Ellis in Dance with a Stranger (1985) and went on to receive Academy Award nominations for Damage (1992) and Tom & Viv (1994). A seven-time BAFTA Award nominee, she won the BAFTA Award for Best Actress in a Supporting Role for Damage. She has also been nominated for seven Golden Globe Awards, winning twice for Enchanted April (1992) and the TV film Fatherland (1994). In 1996, one critic asserted that she is \"the greatest actress of our time in any medium\" after she appeared in Orlando at the Edinburgh Festival.  Richardson began her career in 1979 and made her West End debut in the 1981 play Moving, before being nominated for the 1987 Olivier Award for Best Actress for A Lie of the Mind. Her television credits include Blackadder (1986–1989), A Dance to the Music of Time (1997), Merlin (1998), The Lost Prince (2003), Gideon's Daughter (2006), the sitcom The Life and Times of Vivienne Vyle (2007), and Rubicon (2010). She was nominated for the 2015 Primetime Emmy Award for Outstanding Narrator for Operation Orangutan.\n\nDescription above from the Wikipedia article Miranda Richardson, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
