    "biography": "Morgan Lennon is an NYC based Actor - Singer - Voice Over Artist.\n\nMorgan is an intriguing young professional with a charming smile and a mysterious edge. She can play the intelligent best friend or the bold rookie but her overall strength is in her innate ability to keep the viewer mesmerized even if she is not doing anything at all. She is someone an audience will root for.\n\nShe received a BFA in Drama at NYU Tisch where she studied Musical Theatre at the New Studio on Broadway and Screen Acting at Stonestreet Studios. She studies with Vance Barber and Bob Krakower.\n\nTelevision: Morgan booked her first Network Co-Star on FBI: Most Wanted Episode 302. She has also been sent to producers for three more Network Episodics, so we're looking forward to our next viewing party. Her other recent television work includes a lead in the Pilot Mary and the Mob and she is attached to an upcoming horror anthology series set to film in 2022.\n\nFilm: Morgan booked roles in her first four Feature Films: Something From Tiffany's (Amazon - Hello Sunshine), Soul To Keep (Wishflower Entertainment), The Last Shift (Welcome Villain Films), and New Me (Lions Roar Productions). Her other recent film work includes Just A Story (noir/romance short), Escape the Doom (dark comedy short), Straightedge (angsty mystery short), & Almost (web series).\n\nTheatre: Morgan's most recent musical theatre work includes Mary Poppins (Mary Poppins), Sweeney Todd (Mrs. Lovett), and In the Heights (Nina). She has also performed at many cabarets throughout NYC.\n\nVoice Over: Morgan has done commercial voice over for Bank of America and Lockheed Martin. Her voice will also be featured in an exhibit in the National Museum of the United States Army.",
