    "biography": "Patti Ann LuPone (born April 21, 1949) is an American actress and singer, who is best known for her work in stage musicals. She has won two Grammy Awards, two Tony Awards, and two Olivier Awards. She is also a 2006 American Theater Hall of Fame inductee.  On television, LuPone played Lady Bird Johnson in the 1987 TV movie, LBJ: The Early Years, starred in the drama series Life Goes On (1989–1993) and received Emmy Award nominations for the TV movie The Song Spinner (1995) and her guest role in the sitcom Frasier (1998).  In the 1990s she had a recurring role as defense attorney Ruth Miller on Law & Order.  She also had recurring roles in two Ryan Murphy FX series, the thriller American Horror Story: Coven (2013–2014) and the drama Pose (2019), as well as on Murphy's Hollywood on Netflix. She guest starred in Penny Dreadful (2014–2016) before returning in a lead role. She voices the character Yellow Diamond in the animated series Steven Universe (2013–2019) and its epilogue series Steven Universe Future (2019–2020). She also appeared on The CW comedy Crazy Ex-Girlfriend as Rabbi Shari (2017).  LuPone appeared in the Oscar-winning films Witness (1985) and Driving Miss Daisy (1989) and also was featured in State and Main (2000), Parker (2013), and The Comedian (2016). LuPone has a mezzo-soprano vocal range, and she is famous for her strong/high \"Broadway\" belt singing voice. In a 2008 interview, she maintained that she was \"an actor who sings\", and thankful she \"had a voice\"",
