    "biography": "Ever Gabo Anderson, born on November 3, 2007, in Toronto, Canada, is a Canadian-American actress and model. She is the daughter of American actress Milla Jovovich and British director Paul W. S. Anderson, and has two younger sisters, Dashiel and Osian. Her ancestry includes Russian and Serbian roots from her mother's side and English heritage from her father's lineage.\n\nDespite initial attempts by her parents to dissuade her from pursuing acting, Ever remained steadfast in her pursuit. Fluent in English and Russian, she is also proficient in French, residing in Hollywood Hills, Los Angeles, California, where she practices taekwondo.\n\nAt the age of nine, Ever graced the cover of Vogue Bambini, photographed by Ellen von Unwerth, and captured the attention of renowned photographers like Karl Lagerfeld, Mikael Jansson, and Peter Lindbergh.\n\nHer debut in a feature film occurred in \"Resident Evil: The Final Chapter\" (2016), directed by her father. In this film, she portrayed a younger version of Alicia Marcus, a character her mother portrayed as an adult. Ever gained recognition for her portrayal of the young Natasha Romanoff in the film \"Black Widow\". Additionally, she played the role of Wendy Darling in the film \"Peter Pan & Wendy\", marking significant milestones in her burgeoning career as an actress.",
