    "biography": "William Jack Poulter (born 28 January 1993) is an English actor. He first gained recognition in School of Comedy (2009) and then for his role as Eustace Scrubb in the adventure film The Chronicles of Narnia: The Voyage of the Dawn Treader (2010) and his starring role in the comedy film We're the Millers (2013). He won the BAFTA Rising Star Award in 2014.\n\nPoulter starred in the first and third films of the dystopian science fiction trilogy The Maze Runner (2014–2018), the period film The Revenant (2015), the drama film Detroit (2017), the interactive film Black Mirror: Bandersnatch (2018), and the horror film Midsommar (2019). In 2021, he had a leading role in the Hulu miniseries Dopesick, for which he received an Primetime Emmy Award nomination for Outstanding Supporting Actor. In 2023, he joined the Marvel Cinematic Universe as Adam Warlock in Guardians of the Galaxy Vol. 3 and had a recurring role in FX's series The Bear, which earned him another Emmy Award nomination.\n\nDescription above from the Wikipedia article Will Poulter, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
