    "biography": "Hailing from the small town of Charlemagne, Québec, Céline Dion has become one of the all-time greatest singers. Céline was born in 1968, the youngest of 14 children. Early in childhood, she sang with her siblings in a small club owned by her parents. From these early experiences, Céline gained the know-how to performing live. At the age of 12, Dion composed a song in her native French and sent it to a record company, where it garnered the attention of René Angélil, a respected manager. Angélil believed in Céline so much that he actually mortgaged his house in order to finance her debut album. Already very popular and successful internationally, Céline burst onto the U.S. stage when she recorded the theme song to Disney's hit Beauty and the Beast (1991). The song garnered a Grammy and an Oscar, and from this point Céline has brought forth hit after hit.",
