    "biography": "Billy Barratt is an English actor and musician who has been performing professionally since the age of six. He has appeared in numerous film, TV, and West End theatre productions. He trained at the prestigious Sylvia Young Theatre School and ELAM Arts School. In 2020, at just 13 years old, Billy made history as the youngest recipient of the International Emmy Award for Best Performance by an Actor, for his lead role in the psychological drama Responsible Child (BBC/Kudos). In the critically acclaimed drama, Billy portrayed Ray, a 12-year-old child on trial for the brutal murder of his stepfather. The production won the International Emmy Award for Best TV Movie and earned two BAFTA nominations. Billy's powerful performance as Ray also secured him a nomination for Best Newcomer at the 2020 National Film Awards. In 2021, Billy captured audiences as the troubled outcast Caspar Morrow in Apple TV's high-budget sci-fi series Invasion. The series, created and executive produced by Academy Award and Emmy-nominated Simon Kinberg (The Martian) and David Weil (Hunters), featured Billy as the emotional heart of its UK storyline. The show was renewed for a second and third season, with Billy's layered portrayal continuing to resonate with viewers. Billy also starred alongside Mckenna Grace, Kid Cudi, and Isaiah Russell-Bailey in Disney+'s coming-of-age space adventure Crater. In 2024, he is set to appear in the highly anticipated Sony/Marvel production Kraven the Hunter alongside Russell Crowe and Aaron Taylor-Johnson. Additionally, Billy joins an all-star cast, including Dave Bautista, Anna Faris, Chloe Coleman, and Ken Jeong, in Amazon's My Spy: The Eternal City. Billy's previous film credits include Blinded by the Light, Mary Poppins Returns, Sharknado 5, The Other Me, To Dream, and The Islander. On television, his credits include Invasion (Seasons 1 and 2, Apple TV), A Christmas Carol (Ridley Scott/Tom Hardy/BBC), Mr. Selfridge (ITV), The White Princess (Starz), and The Alienist (Netflix). When not on set, Billy is the frontman and guitarist for his band, The Hunger.\n\nIMDb mini bio by; yusufpiskin",
