    "biography": "Bert Kreischer (born November 3, 1972), nicknamed \"The Machine\",[2] is an American stand-up comedian, podcaster, reality television host and actor. In 1997, he was featured in an article in Rolling Stone while attending Florida State University.[3] The magazine named Kreischer \"the top partyer at the Number One Party School in the country.\"[3] The article also served as inspiration for the 2002 film National Lampoon's Van Wilder.[4] Kreischer has served as host of the television series Hurt Bert on FX as well as Bert the Conqueror and Trip Flip on Travel Channel.[5][6][7][8][9] He is slated to appear in The Machine, a comedy film based on his life.[10]\n\nHe is the producer and host of Bertcast, a weekly comedy podcast on the All Things Comedy network. He is also the co-host of the 2 Bears, 1 Cave podcast with fellow comedian Tom Segura, and co-host of the Bill Bert podcast with actor and comedian Bill Burr.\n\nFrom Wikipedia the free encyclopedia.",
