    "biography": "Jorge Damián Alcázar Castello is a renowned Mexican actor, born in Jiquilpan, Michoacan, on January 8, 1953. One of the most talented and recognized contemporary actors, Damián studied at the National Institute of Fine Arts, and later studied at the Centro of Theater Experimentation and, later, at the Faculty of Theater at the Universidad Veracruzana, where, years later, he would be a teacher.  After several years in the theater, Damián made his film debut with The Center of the Labyrinth (1985), and later worked in films such as Romero (1989), The Naked City (1989), Bandidos (1991), Mujer del Puerto (1991). ), Lolo (1993), where he would win his first Ariel award, for best male co-acting, and Two crimes (1994), by Roberto Sneider, for which he was nominated, again, for the Ariel. The success of the film and his performance immediately propelled his career, which would lead him to participate in films such as En el aire (1995), El anzuelo (1996), Hombres armamos (1997), Baja California: El limit del tiempo ( 1998) and Herod's Law (1999), winning two consecutive Ariel Awards for both films, as best actor, in 1998 and 1999.  With director Luis Estrada, Alcázar would star in a successful saga of films, with a social and critical spirit, with the films A Wonderful World (2006), Hell (2010) and The Perfect Dictatorship (2014), each one proving successful at the box office and criticismo.\n\nIn 2018 the Academy of Motion Picture Arts and Sciences invited him to be a special part of its new members.\n\nAlcazár has a vast filmography, which includes film and television.  He is considered one of the most important actors of new Mexican cinema.",
