    "biography": "​Fantasia Monique Barrino (born June 30, 1984) commonly known as Fantasia, is an American R&B singer, Broadway and television actress who rose to fame as the winner of the third season of the reality television series American Idol in 2004. Following her victory, she released her debut single, \"I Believe\", which debuted at number one on the Billboard Hot 100. Subsequently, she released her debut album, Free Yourself, which went on to be certified Platinum by the RIAA and garnered Barrino three Grammy nominations in 2006.  Her accolades include two Billboard Music Awards and a Grammy Award, along with nominations for a Golden Globe Award, a BAFTA Award, and three American Music Awards.\n\nIn 2006, she released her second album, Fantasia, which featured the single \"When I See U\" which topped the Billboard Hot R&B/Hip-Hop Songs chart for eight weeks. The album was certified Gold by the RIAA and received three Grammy nominations in 2008. She then played the part of Celie in the Broadway musical The Color Purple, for which she won a 2007 Theatre World Award. Her third studio album, Back to Me, was released worldwide on August 24, 2010 and features the single \"Bittersweet,\" which peaked in the top ten on the R&B chart. The single won her a Grammy for Best Female R&B Vocal Performance.",
