    "biography": "Albert Brooks (born Albert Lawrence Einstein; July 22, 1947) is an American actor and filmmaker. He received an Academy Award nomination for Best Supporting Actor for 1987's Broadcast News and was widely praised for his performance as a ruthless Jewish mobster in the 2011 action drama film Drive. Brooks has also played in Taxi Driver (1976), Private Benjamin (1980), Unfaithfully Yours (1984), and My First Mister (2001). He has written, directed, and starred in several comedy films, such as Modern Romance (1981), Lost in America (1985), and Defending Your Life (1991). He is also the author of 2030: The Real Story of What Happens to America (2011).\n\nHis voice acting credits include Marlin in Finding Nemo (2003) and Finding Dory (2016), Tiberius in The Secret Life of Pets (2016), and several one-time characters in The Simpsons, including Hank Scorpio in \"You Only Move Twice\" (1996) and Russ Cargill in The Simpsons Movie (2007).\n\nDescription above from the Wikipedia article Albert Brooks, licensed under CC-BY-SA, full list of contributors on Wikipedia.​",
